import * as types from './../constants/ActionTypes';

//Khai báo giá trị mặc định
let initialState = [
    {
        id: '1',
        namework: 'abc',
        status: 1
    }
];

//Khởi tạo reducer
let myReducer = (state = initialState, action) => {
    switch(action.type){
        case types.LIST_ALL:
            return state;
        default:
            return state;
    }
    // return state;
};

export default myReducer;
